const initialValue = {
    data: []
}

const LoginData = (state = initialValue, action) => {
    let newData = action.payload;
    switch (action.type) {
        case "FetchLoginData":
            return {
                ...state,
                data: { ...state.data, newData }
            }
        default: return state;
    }
    console.log(state)
}

export default LoginData;
